import "./btn.scss";
import "../../assets/styles/line-awesome/scss/line-awesome.scss";

class Btn extends React.Component {
  constructor(props) {
    super(props);
  }
  state = {};
  render() {
    return (
      <div className="btn">
        <ul>
          <li>
            <i className="las la-home"></i>
            <a href="">home</a>
          </li>
        </ul>
      </div>
    );
  }
}

export default Btn;
